creditsText:"NASA/CXC/NCSU/K.J.Borkowski et al. The supernova remnant (SNR) N132D is the brightest in the Large Magellanic Cloud, and it belongs to a rare class of oxygen-rich remnants. In this Chandra image, low energy X-rays are colored red, the medium energy range are green, and the highest energy X-rays are blue. Substantial amounts of are detected, particularly in the green regions near the center of the image. Most of the oxygen on Earth is thought to come from stellar explosions similar to this one.",
