creditsText:"NASA/CXC/Wisconsin/D.Pooley et al. On January 9, 2008, NASA's Swift satellite was used to fortuitously observe a very bright X-ray outburst in the spiral galaxy NGC 2770, located 90 million light-years from Earth. In a Nature paper, astronomers show that the properties of the X-ray outburst are consistent with a shock wave bursting through the surface of a massive star that has just collapsed, the first time such an event has been seen. This outburst marked the very early stages of a supernova explosion called SN 2008D.",
