creditsText:" X-ray (NASA/CXC/NCSU/S.Reynolds et al.); Radio (NSF/NRAO/VLA/Cambridge/D.Green et al.) A composite image of X-ray (orange) and radio (blue) data from NASA’s Chandra X-ray Observatory and the Very Large Array shows the remains of the supernova remnant G1.9+0.3. By comparing the images that were obtained over 20 years apart, scientists can determine how quickly it is expanding and therefore when its progenitor exploded. G1.9+0.3 was created about 140 years ago, making it the most recent supernova in the Milky Way. It was not detected in optical light because it is near the center of the Galaxy and obscured by gas and dust",
