creditsText:"NASA/CXC/Wisconsin/D.Pooley & CfA/A.Zezas. The biggest black holes may feed just like the smallest ones, according to data from NASA's Chandra X-ray Observatory and ground-based telescopes. This discovery supports the implication of Einstein's relativity theory that black holes of all sizes have similar properties, and will be useful for predicting the properties of a conjectured new class of black holes. The conclusion comes from a large observing campaign of the spiral galaxy M81, which is about 12 million light years from Earth. ",
