creditsText:"X-ray: NASA/CXC/CfA/W. Forman et al.; Radio: NRAO/AUI/NSF/W. Cotton; Optical: NASA/ESA/Hubble Heritage Team (STScI/AURA), and R. Gendler. This image is a composite of visible (or optical), radio, and X-ray data of the giant elliptical galaxy, M87. M87 lies at a distance of 60 million light years and is the largest galaxy in the Virgo cluster of galaxies",
