creditsText:"NASA/CXC/CfA/W. Forman et al. In X-rays, M87 reveals evidence for a series of outbursts from the central supermassive black hole. The loops and bubbles in the hot, X-ray emitting gas are relics of small outbursts from close to the black hole. Other interesting features in M87 are narrow filaments of X-ray emission, which may be due to hot gas trapped by magnetic fields. One of these filaments is over 100,000 light years long, and extends below and to the right of the center of M87 in almost a straight line. ",
